  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:28.636132\",\n\t\"name\": \"phase-i-report-evaluating-marsh-and-upland-habitat-management-techniques-and-their-resulti\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report is the result of a lawsuit
  that Monte Vista National Wildlife Refuge and other refuges were involved in focusing
  on the compatibility issue related to livestock grazing during the growing season.
  \ As a result of the settlement agreement, a research study was implemented to focus
  on an evaluation of refuge management tools.  After consideration of the complexities
  associated with refuge operations in the San Luis Valley it became clear that a
  major concern was controlling whitetop in Rio Grande and Alamosa counties.  Because
  of this concern for noxious weeds and especially tall whitetop by ranchers and county
  commissioners in conjunction with the poor understanding of whether grazing influences
  the distribution and control of tall whitetop, the research proposal focused on
  how grazing during the growing season impacted native plant communities and tall
  whitetop. Research preformed on the refuges were on the temporal and spatial effects
  of grazing on white top (Lepidium latifolium) and native wetland vegetation and
  Small mammal and raptor response to intensive grazing on Monte Vista and Alamosa
  National Wildlife Refuges.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
